import React from 'react';
import { Container, Row, Col,Table } from 'react-bootstrap';

const List = () => {
    return(
        <Container>
            <h3>ข้อมูล</h3>
        <Table>
        <thead>
        <tr>
          <th>#</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Username</th>
        </tr>
      </thead>
        </Table>

    </Container>
    );
}
export default List;
